Properly retrieve and display data from Mongoose / MongoDB .find method<p>I am working on a command line app in Node.js that involves retrieving results from a database (DB) using Mongoose. One important function I created just is not working no matter how hard I try and how many tutorials I go through.</p>

<p>The main purpose of the function is to look and see if the database (a simple word bank) has an entry containing given phrase / word.</p>

<p>Here is the full code setup for the particular function:</p>

<pre><code>const mongoose = require('mongoose'),
    mongoSettings = {
        useNewUrlParser: true,
        useUnifiedTopology: true
    },
    wordSchema = new mongoose.Schema(
        { item: String }
    );

/**
 * Looks for a given word or phrase in database.
 * Will eventually return a boolean.
 * 
 * @param {string} word2LookUp Word or phrase to search for
 * @param {string} lang Which language list to search in [english (default), spanish, or french]
 */

const inWordBank = (word2LookUp,lang="english") =&gt; {
    mongoose.connect('mongodb://localhost:27017/word-bank', mongoSettings);
    mongoose.connection
      .once("open",()=&gt;{
        console.log(`// ----- Searching for: "${word2LookUp}"...`);

        const Word = mongoose.model('Word', wordSchema,lang);
        Word.find({item: word2LookUp}, function (err, words) {

            console.log(words); // &lt;---------[ WHERE I'M HAVING TROUBLE ]

        });

        mongoose.connection.close();
      })
      .on("error", error =&gt; {
        console.log("&gt;&gt;&gt; Error: ",error)
        mongoose.connection.close();
      });
}

module.exports = {
    inWordBank: inWordBank
}
</code></pre>

<p>This is how I am trying to execute the function on my <code>app.js</code> file:</p>

<pre><code>const wordBank = require("./wordBank");

wordBank.alreadyRegistered("fem");
</code></pre>

<p>All I get in the console is:</p>

<pre><code>// ----- Searching for: "fem"...
undefined
undefined
undefined
</code></pre>

<p>Some additional tidbits: </p>

<ul>
<li>There's 3 documents in the particular DB in question that contain "fem" in their "item" section. That's probably why there is <code>undefined</code> 3 times for some odd reason.</li>
<li>The DB works fine when I write to it so I know it's not a connection issue</li>
<li>There are no other errors generated.</li>
<li>In my <code>package.json</code> file, my dependencies look like this:</li>
</ul>

<pre><code>  "devDependencies": {
    "chai": "^4.2.0",
    "mocha": "^6.2.2"
  },
  "dependencies": {
    "mongoose": "^5.7.10"
  }
</code></pre>

<p>Is there an important piece of the puzzle I'm simply missing? Or do I have to rewrite this from square 1?</p>

