How to use $ne in a $match along with $lookup in mongodb<p>I have 3 collections as follows:</p>

<ol>
<li>doctor.</li>
<li>professionalDetails </li>
<li>appointments</li>
</ol>

<p>I would like to have all the available appointments for a doctor which are not in the appointments collection. 
I have tried the following query and been working on it from hours:</p>

<pre><code>  const appointments = await Doctor.aggregate([
            {$match: {role: 'DOCTOR', _id: ObjectId(doctorId)}},
            {
              $lookup: {
                from: 'professionalDetails', 
                localField: '_id', 
                foreignField: 'doctorId', 
                as: 'professionalDetails'
              }
            },
            {
              $lookup: {
                from: 'appointments', 
                localField: '_id', 
                foreignField: 'doctorId', 
                as: 'appointments'
              }
            },
            {$unwind: "$professionalDetails"},
            {$unwind: "$professionalDetails.schedule"},
            {$match: {'professionalDetails.schedule.day': 'Tuesday'}},
            {$unwind: "$professionalDetails.schedule.timmings"},
            {$unwind: "$appointments"},
            {$match: {'professionalDetails.schedule.timmings._id': {$ne: 'appointments.slotId'}}},
            {
              $project: {
                _id: 0,
                time: '$professionalDetails.schedule.timmings.slot',
                _id: '$professionalDetails.schedule.timmings._id'
              }
            }
          ]);
</code></pre>

<p>The above still returns all the slots.
However if I hardcode the not equal match as follows it works:</p>

<pre><code>{$match: {'professionalDetails.schedule.timmings._id': {$ne: ObjectId('5dd2a9cab4a4a32c9359ac1f')}}}
</code></pre>

<p>Also both the ids are Object Ids in the mongoose model and not strings.</p>

<p>I am pretty new to it. Guidance is really appreciated!</p>

<p>Please help!
Thanks in advance!</p>

