<p>Edit: add query.</p>

<pre><code>collection.updateOne(
  { _id: entity._id },
  { $set: entity },
  { upsert: true }
)
</code></pre>

<p>Edit: try delete.
Even when I delete the property, no luck.</p>

<pre><code>const upsertTest = (collection) =&gt; {
  const entity = { date: new Date() };
  console.log(entity);
  // { date: 2019-11-19T22:16:00.914Z }

  const _id = entity._id;
  delete entity._id;
  console.log(entity);
  // { date: 2019-11-19T22:16:00.914Z }

  collection.updateOne(
    { _id: _id },
    { $set: entity },
    { upsert: true }
  );

  console.log(entity);
  // { date: 2019-11-19T22:16:00.914Z }
}
</code></pre>

<p>But the new document is this:
<a href="https://i.stack.imgur.com/zBLfg.png" rel="nofollow noreferrer">screenshot of new document</a></p>

