How Do I aggregate mongoDB query which retrieves data monthly between two Dates?<p>I have the following collection,</p>

<pre><code>Todos = {
username:{ type: String},
type: {type: String}     // can be A | B
todos: [
 title: {type: String},
 createdAt: {type: String} 
]
}
</code></pre>

<p>Suppose I have inputs <code>fromDate = "1-3-2019", toDate = "1-5-2019" and type = "A"</code>
this should result in the count of todos of all the users with type: "A" of months 3 and 4 individually.</p>

<p>I have tried this.</p>

<pre><code>const result = await Todos.aggregate([
        {
          $match: { type: 'A' }
        },
        {
          $project: {
            todos: {
              $filter: {
                input: '$todos',
                as: 'todo',
                cond: {
                  $and: [
                    {
                      $gte: [
                        { $toDate: '$$todo.createdAt' },
                        { $toDate: fromDate }
                      ]
                    },
                    {
                      $lte: [
                        { $toDate: '$$todo.createdAt' },
                        { $toDate: toDate }
                      ]
                    }
                  ]
                }
              }
            }
          }
        },
        { $group: { _id: '', count: { $sum: { $size: '$todos' } } } },
        { $project: { totalTodos: '$count' } }
      ])
</code></pre>

<p>But this is an inappropriate result what I want instead of the result with 2 counts, the first count will give the todos of March, and the second will gives all todos of April since there are two months between this input dates.</p>

<p>Any help would be appreciated Thank you.</p>

